import "./Desktop1.css";

const Desktop1 = () => {
  return (
    <><head><link rel="stylesheet" href="https://kit.fontawesome.com/cedf5ae29a.css" crossorigin="anonymous"></link></head>
    <body className="body">

    <div className="desktop-1">
          <h2>Enter your Details</h2>

          <div class="box">
                <i class="fa fa-user"></i>

                <input type="email" name="email" id="email" placeholder="Enter your Email" ></input>
            </div>

    </div>
    </body></>
  );
};

export default Desktop1;
